import React, { useState } from 'react'

function App() {
  const spisok = [

    { id: 0, name: 'Дело 1' },
    { id: 1, name: 'Дело 2' },
    { id: 2, name: 'Дело 3' },

  ]

  const [STspisok, changeSTspisok] = useState(spisok)

  const result = STspisok.map((id, name) => {
    return <li key={id}>{name}</li>;
  })
  return (
    <div>
      <ul>
        {result}
      </ul>
    </div>
  )
}

export default App;
